  return user.firstname + ' ' + user.lastname;
}
const user = {
  firstname:'Hello',
  lastname :"World "
}
function getgreether(user){
  if(user){
    return <h1>Hello {formatname(user)}</h1>
  }
  return <h1>Hello Stranger !</h1>
}
const element = (
  <>
      {getgreether(user)}
  </>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* <App /> */}
    {element}
  </React.StrictMode>
);

